"Become ShopeeFood Merchant","rebranding.SHIP_BY_DELIVERYNOW":"Ship by ShopeeFood","rebranding.app_description_change_to_now":'<h3 style="font-size: 36px;font-weight: lighter;margin-bottom: 0;">Hello you!</h3><p style="font-size: 15px;margin-top: 9px;margin-bottom: 9px;">We are pleased to inform you that our application<span class="bold"> ShopeeFood</span> is changed its name to</p><span class="btn btn-red font18" title="ShopeeFood" style="cursor: pointer;font-size: 18px !important;background-color: #cf2127;color: #fff;border-color: #cf2127;"><span class="txt-bold" style="font-weight: 700 !important;"> ShopeeFood </span></span>',"rebranding.apply_now":"Apply Voucher","rebranding.by_now":"By ShopeeFood","rebranding.cancelled_order_content":"<span>If you need any helps or give feedback, please sed us an email to&nbsp;<strong>{0}</strong>&nbsp;or send a report directly via the button below. Thank you for using ShopeeFood's services.</span>","rebranding.chat_now_support_title":"Support","rebranding.common_update":"Gi","rebranding.delivery_quality_merchant_description":"This is one of the best rated Merchants on ShopeeFood","rebranding.delivery_service_fee_info":'<span>This place is not a Verified Merchant on<strong style="color:red">ShopeeFood</strong>. You will be charged a service fee of  <strong>{0}</strong></span>',"rebranding.delivery_shipping_fee_message":"<div> The minimum shipping fee of ShopeeFood service is&nbsp; <strong>{0}</strong> </div><div> Shipping fee: <strong>{1}{2}&nbsp;*&nbsp;{3}</strong> </div><div>(Shipping fee can be changed by your delivery time)</div>","rebranding.do_you_want_to_logout":"Do you want to logout ShopeeFood?","rebranding.home_footer_intro_description1":'<p class="font15">ShopeeFood will protect your purchase order from the weather by using bag or box during shipping.</p>',"rebranding.home_footer_intro_title1":"How about your purchase order protection?","rebranding.home_footer_intro_title3":'<span style="color: #EE4D2D;font-weight: bold;">ShopeeFood</span> is seeking for ShopeeFood Partners',"rebranding.home_intro_merchant_contact":"Contact ShopeeFood","rebranding.home_intro_merchant_text":"Contact ShopeeFood for supports of POS, Logistic, Payment to get more customers","rebranding.home_search_follow_order_with_app":"Better experiences with ShopeeFood App","rebranding.install_app_partner":"App T i x","rebranding.landing_page_free5_download_app":"Ti ng dng <strong>ShopeeFood</strong>","rebranding.limit_distance_title_now_setting":"ShopeeFood service is out of delivery distance","rebranding.meaning_preferred_merchant_txt":"(Preferred Merchant is one of the best rated Merchants on ShopeeFood)","rebranding.merchant_not_support_shipping_method":"Web don't support delivery in this merchant. Please change to order in ShopeeFood/Foody app.","rebranding.merchant_register_answer_item_1":"Welcome Package is is a promotion program for new shops to join ShopeeFood, helping to increase sales for shops through the support of discount codes and increasing visibility in the first weeks on ShopeeFood.","rebranding.merchant_register_answer_item_10":"Hotline: 1900 2042","rebranding.merchant_register_answer_item_2":"The Welcome Package program is for restaurants for the first time signed a contract with ShopeeFood. However, to enjoy more benefits, partners need to satisfy additional conditions such as: having ShopeeFood Merchant app, using ShopeeFood Merchant Wallet, installing ShopeePay QR Code and menu image over 80%.","rebranding.merchant_register_answer_item_3":"From 5-15 working days (except Saturday, Sunday and public holidays)","rebranding.merchant_register_answer_item_4":"3 working days (except Saturday, Sunday and public holidays)","rebranding.merchant_register_answer_item_5":"ShopeeFood has 2 payment methods (i) Cash and (ii) Online payment via ShopeeFood Merchant Wallet.\nWith ShopeeFood Merchant Wallet payment method, you will receive payment instantly after confirming each order. No need to wait for ShopeeFood drivers\nto come and pay.","rebranding.merchant_register_answer_item_6":"Once signing the contract, you cannot change your shop name and shop owner/representative. In order to make any adjustments above, you must re-sign a new contract with updated information","rebranding.merchant_register_answer_item_7":"Preferred Merchant is ShopeeFood Partner Merchant with excellent sales and operation.\nPreferred Merchants privileges includes:\n- Preferred Merchant badge attached to your shop on ShopeeFood platform.\n- Priority in our recommendation list.\n- Entitled to join our Free Ship Special campaigns with lower commission.\n- Entitled to join our exclusive campaigns designed for Preferred Merchants only.\nOn the 1st day of each month, ShopeeFood will base on your shop sales and operation performance to decide whether your shop is Preferred Merchant or not.","rebranding.merchant_register_answer_item_8":"ShopeeFood Merchant is a delivery order management app designed exclusively for ShopeeFood Partner Merchants. You can easily manage your orders, access to your shop sales and operation report, set promotions, view and reply to you shop reviews, set up your shop menu and info, etc...","rebranding.merchant_register_answer_item_9":"ShopeeFood Merchant Wallet is a tool to manage your online payments from ShopeeFood. It allows you receive payment instantly after each confirmed order without waiting for ShopeeFood drivers to come and pay.","rebranding.merchant_register_become_now_partner":"Become our Partner Merchant now","rebranding.merchant_register_header_sub_title_1":"Large-scale driver network with well-trained delivery skills","rebranding.merchant_register_header_sub_title_2":"We offer order management tools to help merchants to optimize their operations and proactively customize their shops on ShopeeFood","rebranding.merchant_register_header_sub_title_3":"Opportunity to join the our Welcome Package with many attractive benefits & help to boost sales effectively.",